import React from "react";
const path = require("path");

function Project() {
  return (
    <div>
      <div className="card">
        <div className="card-header">Ford Finder</div>
        <img
          src={require("./assets/ford.jpg")}
          className="card-img-top"
          alt="Ford Finder App"
        ></img>
      </div>
    </div>
  );
}

export default Project;
